import React, { useState, useEffect } from 'react';
import SubjectService from './service/SubjectService';

function AdminSubjectManagementPage() {
  const [subjects, setSubjects] = useState([]); // Initialize subjects state with an empty array

  useEffect(() => {
    fetchSubjects();
  }, []);

  const fetchSubjects = async () => {
    try {
      const token = localStorage.getItem('token'); 
      const response = await SubjectService.getAllSubjects(token);
      setSubjects(response.subjects || []); // Ensure to set subjects state even if response.subjects is undefined
    } catch (error) {
      console.error('Error fetching subjects:', error);
    }
  };

  return (
    <div className="profile-page-container">
      <h2>Subject Management Page</h2>
      <ul>
        {subjects.map(subject => (
          <li key={subject.id}>{subject.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default AdminSubjectManagementPage;
